import { Box, Button, Grid } from "@mui/material";
import React from "react";
import logo from "../images/logo.png";

const commonButtonStyles = {
    backgroundColor: "purple",
    }

const Header = () => {
  return (
    <Grid container sx={{ background: "pink", padding: 2 }}>
      <Grid item xs={12} md={3}>
        <img src={logo} style={{ height: "40px", width: "40px" }} />
      </Grid>
      <Grid
        item
        xs={12}
        md={9}
        sx={{ display: "flex", justifyContent: "space-between" }}
      >
        <Button varient='contained' sx={{backgroundColor:'white'}}>Home</Button>
        <Button varient='contained' sx={{backgroundColor:'white'}}>About us</Button>
        <Button varient='contained' sx={{backgroundColor:'white'}}>Contact us</Button>
      </Grid>
    </Grid>
  );
};

export default Header;
